import Cookies from 'js-cookie';
import React from 'react';
import { withRouter } from "react-router-dom";

const Authverify = (props) => {
    props.history.listen(() => {
        if(!Cookies.get('user')){
            props.logOut();
        }
    })

  return (
    <></>
  )
}

export default withRouter(Authverify);
